## PREMESSA

 Con il presente bando la Regione Emilia-Romagna dà attuazione, per l'anno 2021, agli interventi previsti nel Programma di Sviluppo Rurale 2014-2020 per il tipo di operazione 6.1.01 "Insediamento dei giovani agricoltori" nonché per il tipo di operazione 4.1.02 "Investimenti in azienda agricola per giovani agricoltori beneficiari di premio di primo insediamento", nelle ipotesi di attivazione in forma integrata (cosiddetto "Pacchetto giovani").

 Il presente bando definisce i criteri e le procedure di attuazione di entrambi i tipi di operazione e disciplina la presentazione delle domande di aiuto e pagamento da parte dei potenziali beneficiari ed il relativo procedimento.

 ## Sezione I - Descrizione requisiti e condizioni tipo di operazione 6.1.01

 ## 1. Riferimenti normativi

 I riferimenti normativi sono:

 - -Programma di Sviluppo Rurale della Regione Emilia-Romagna per il periodo 20142020 - Versione 11.1 - attuativo del citato Regolamento (UE) n. 1305 del 17 dicembre 2013, nella formulazione approvata dalla Commissione europea con Decisione C(2021) 6321 final del 23 agosto 2021, di cui si è preso atto con deliberazione di Giunta regionale n. 1353 del 30 agosto 2021;
 - -Reg. (UE) n. 1303/2013;
 - -Reg. (UE) n. 1305/2013, in particolare art. 19, comma 1) lettera a), i) e successive modifiche;
 - -Reg. Delegato (UE) n. 807/2014, che integra talune disposizioni del Reg. (UE) n. 1305/2013;
 - -Reg. di Esecuzione (UE) n. 808/2014, recante modalità di applicazione del Reg. (UE) n. 1305/2013;
 - -Reg. Delegato (UE) n. 640/2014 per quanto riguarda il sistema integrato di gestione e di controllo e le condizioni per il rifiuto o la revoca di pagamenti nonché le sanzioni amministrative applicabili ai pagamenti diretti, al sostegno allo sviluppo rurale e alla condizionalità;
 - -Reg. di Esecuzione (UE) n. 809/2014 recante modalità di applicazione del Regolamento (UE) n. 1306/2013 del Parlamento europeo e del Consiglio per quanto riguarda il sistema integrato di gestione e

altre zone. Lo svolgimento di attività lavorative extra - aziendali che producono un reddito annuo lordo superiore alla soglia di riferimento determina la revoca dei benefici anche se già concessi, fatto salvo quanto previso dall'Allegato 10 "Tabelle di riduzione dell'aiuto in caso di mancato rispetto degli impegni";
 - 4.4. essere regolarmente iscritto all'INPS - gestione agricola, quale imprenditore agricolo secondo le indicazioni previste all'ultimo paragrafo del presente punto 4;
 - 4.5. impegnarsi a condurre l'azienda oggetto dell'insediamento per almeno sei anni, decorrenti dal momento dell'insediamento medesimo; nel corso di durata del vincolo alla conduzione diretta da parte del giovane non sono consentite operazioni di subentro, fusioni o incorporazioni societarie;
 - 4.6. soddisfare una delle seguenti condizioni per il riconoscimento del primo insediamento:
 - 4.6.1. il giovane agricoltore acquisisce la titolarità di una impresa agricola mediante l'apertura di partita IVA come ditta individuale;
 - 4.6.2. se il/i giovani agricoltori si insediano in qualità di contitolare in società di persone, il premio viene corrisposto a condizione che la responsabilità per la gestione ordinaria e per quella straordinaria, quale risultante dal patto societario, sia in capo al/ai soci giovani agricoltori in modo tale per cui le decisioni del/dei giovani agricoltori non possano essere inficiate dagli ulteriori soci. Pertanto, nelle forme di società semplice (s.s.) e di società in nome collettivo (s.n.c), il/i soci giovani agricoltori dovranno essere anche amministratori della società. Qualora il socio giovane agricoltore non sia amministratore unico, dovrà inoltre avere la maggioranza di quote di ripartizione degli utili, nonché quella delle quote sociali qualora la responsabilità di amministrazione sia ricondotta a queste ultime. Si precisa altresì che la responsabilità dell'amministratore giovane agricoltore non potrà risultare limitata da ulteriori previsioni statutarie che riconducano in capo ad altri soci specifiche responsabilità in ordine ad ambiti gestionali/operativi dell'impresa, inclusi gli adempimenti relativi ai rapporti di lavoro, in materia di collocamento, contributivi, previdenziali, fiscali. Nella società in accomandita semplice (s.a.s.) il/i soci

impresa agricola

 L'impresa agricola già dal momento della domanda deve soddisfare le seguenti condizioni, pena la non ammissibilità della domanda:

 - 5.1. risultare iscritta ai registri della CCIAA; qualora al momento della domanda l'iscrizione ai registri della CCIAA non risulti perfezionata, dovrà risultare almeno inoltrata dal beneficiario debita richiesta di iscrizione;
 - 5.2. in caso di ditta individuale, l'esercizio dell'attività agricola di cui all'art. 2135 del c.c., come riportato nell'iscrizione alla CCIAA, deve risultare quale attività primaria;
 - 5.3. in caso di impresa costituita in forma societaria, l'esercizio dell'attività agricola di cui all'art. 2135 del c.c., con riferimento all'oggetto sociale, deve risultare in forma esclusiva;
 - 5.4. risultare iscritta all'Anagrafe regionale delle Aziende Agricole;
 - 5.5. rientrare in una delle seguenti definizioni di impresa, di cui all'All. 1) del Reg. (UE) n. 702/2014:
 - 5.5.1. "microimpresa": un'impresa che occupa meno di 10 persone e realizza un fatturato annuo e/o un totale di bilancio annuo non superiore a 2 milioni di Euro;
 - 5.5.2. "piccola impresa": un'impresa che occupa meno di 50 persone e realizza un fatturato annuo e/o un totale di bilancio annuo non superiore a 10 milioni di Euro;

 Le condizioni per la valutazione del presente requisito sono riportate nell'Allegato 1 al presente bando;

 - 5.6. in caso di società, la durata del contratto societario dovrà essere almeno pari a quella del periodo di impegno alla conduzione aziendale;
 - 5.7. in caso di impresa operante nel settore lattiero-caseario, la stessa dovrà risultare in regola con eventuali pagamenti dovuti per adesione alla rateizzazione o di imputazione di prelievo;
 - 5.8. rispettare le condizioni stabilite dai contratti collettivi nazionali e territoriali di lavoro per il personale dipendente.

 ## 6. Condizioni di ammissibilità dell'azienda agricola

 L'azienda agricola, intesa quale insieme di beni e strutture utilizzati dalla singola impresa agricola, al

momento di presentazione della domanda ordinaria o di rettifica di completamento di quella presentata su modulistica semplificata, deve soddisfare le seguenti condizioni, pena la non ammissibilità della domanda:

 - 6.1. risultare di dimensione economica (espressa in Standard output - di cui al successivo punto 10) non inferiore a 12.000 Euro se in zona con vincoli naturali o altri vincoli specifici (quale definita al successivo punto 12), a 15.000 Euro nelle altre zone. Qualora più giovani si insedino contestualmente nella medesima azienda, detta dimensione minima è da moltiplicare per il numero degli insediati richiedenti il premio;
 - 6.2. risultare di dimensione economica (espressa in Standard Output) non superiore a 250.000 Euro.

 ## 7. Condizioni per dimostrare la sufficiente capacità professionale

 La sufficiente capacità professionale di cui al precedente punto 4.2 viene riconosciuta in uno dei seguenti casi:

 - 7.1. essere in possesso di titolo di studio conseguito in Italia ad indirizzo agrario ovvero all'estero ma legalmente riconosciuto in Italia:
 - 7.1.1. titolo universitario: laurea, diploma di specializzazione o dottorato di ricerca conseguito in facoltà ad indirizzo agrario, forestale o veterinario, inclusi eventuali corsi di laurea interfacoltà compartecipati dalle stesse;
 - 7.1.2. diploma di istruzione secondaria superiore ad indirizzo agricolo;
 - 7.1.3. diploma professionale quadriennale ad indirizzo agricolo;
 - 7.1.4. diploma/certificato di qualifica professionale triennale ad indirizzo agricolo;
 - 7.2. esperienza almeno annuale di conduzione diretta di impresa agricola oppure da dipendente agricolo con mansioni di responsabile aziendale, supportata da una adeguata formazione professionale che potrà essere dimostrata attraverso la presentazione di attestati di frequenza per almeno 100 ore a corsi inerenti le competenze richieste all'imprenditore. I corsi devono prevedere la verifica inte rnafina le, che dovrà risultare sostenuta con esito positivo. Gli attestati devono essere rilasciati da Enti di Formazione e riferirsi ad attività svolte negli ultimi quattro anni. Nel caso di parziale o totale carenza formativa, tale professionalità dovrà essere conseguita con almeno 100 ore di corsi di analoga tipologia (o in modo tale da

 integrare i corsi precedentemente seguiti fino ad almeno 100 ore complessive) che vertano su argomenti

prioritari, quali:

 - 7.2.1. norme e regolamenti della politica agricola comunitaria e delle organizzazioni comuni di mercato, riguardanti l'azienda condotta (obbligatoria);
 - 7.2.2. normative relative alla tutela ambientale in campo agricolo, con particolare attenzione a quelle della Regione Emilia-Romagna (obbligatoria);
 - 7.2.3. sicurezza sul lavoro (obbligatoria);
 - 7.2.4. contabilità e gestione aziendale;
 - 7.2.5. aggiornamento tecnico nel settore produttivo prevalente dell'azienda;
 - 7.2.6. informatica applicata alla gestione aziendale;
 - 7.2.7. formazione tecnica su settori produttivi non ancora presenti in azienda, ma in fase di inserimento;
 - 7.2.8. normativa fiscale;
 - 7.3. esperienza di lavoro di almeno due anni nel settore agricolo (1 anno = 151 giornate lavorative), supportata da una adeguata formazione professionale che potrà essere dimostrata attraverso la presentazione di attestati di frequenza per almeno 100 ore a corsi inerenti alle competenze richieste all'imprenditore agricolo. I corsi devono prevedere la verifica interna finale, che dovrà risultare sostenuta con esito positivo. Gli attestati devono essere rilasciati da Enti di Formazione e riferirsi ad attività svolte negli ultimi quattro anni. Nel caso di parziale o totale carenza formativa, tale professionalità dovrà essere conseguita con corsi di almeno 100 ore (o di una durata tale da completare i corsi precedentemente seguiti fino ad almeno 100 ore complessive) che vertano su argomenti prioritari per la professionalità dell'imprenditore agricolo quali quelli elencati al punto precedente.

 ## 8. Piano di sviluppo aziendale (PSA) - Contenuti e condizioni di ammissibilità

 Il PSA dovrà essere redatto sulla base dello schema di cui all'Allegato 2 al presente bando e presentato contestualmente alla domanda di premio di primo insediamento, pena l'inammissibilità della domanda stessa.

 - Il PSA dovrà necessariamente risultare avviato in data successiva a quella di presentazione della domanda, ma entro 9 mesi decorrenti dalla data di assunzione della decisione individuale di concessione del premio. Detta condizione sarà verificata sulla base dei seguenti elementi:
 - 8.1.1. in caso di azioni volte ad espandere l'azienda agricola, si farà riferimento alla data di stipula dei contratti giustificativi del possesso dei nuovi terreni (esclusi quindi quelli costituenti la consistenza

aziendale al momento della domanda);
 - 8.1.2. nel caso di acquisto di terreni e/o fabbricati produttivi (esclusi quindi quelli costituenti la consistenza aziendale al momento della domanda), si farà riferimento alla data della proposta formale di acquisto;

 - 8.1.3. in caso di previsione di frequenza a corsi di formazione aggiuntivi a quelli necessari per il raggiungimento della sufficiente capacità professionale, si farà riferimento alla data di avvio degli stessi;
 - 8.1.4. in caso di acquisto di beni/servizi diversi da quelli di cui ai punti precedenti, si farà riferimento alla data del documento di trasporto e consegna (DDT, indipendentemente dalla causale: conto vendita, conto prova, conto visione, ecc.) o alla data di pagamento di eventuali acconti/anticipi/caparre, se antecedente. Pertanto, se il bene è già presente in azienda, o per esso sono stati versati anticipi o acconti, prima della presentazione della domanda anche se non è ancora perfezionato l'acquisto, l'investimento si intende avviato. Non rientrano nella presente categoria le spese sostenute propedeutiche alla predisposizione del PSA e dell'eventuale Piano di Investimenti (PI, vd. punto 18), quali onorari di professionisti e consulenti;
 - 8.1.5. nel caso di costruzione/ristrutturazione di beni immobili produttivi, si farà riferimento alla data di inizio attività comunicata al Comune competente, quale risultante dal relativo titolo autorizzativo previsto dalla normativa edilizia vigente.

 Il mancato rispetto anche solo di una tra le suddette condizioni o il mancato rispetto del termine di realizzazione del PSA riportato nella decisione di concessione determina la inammissibilità del PSA nel suo complesso e conseguentemente la decadenza della domanda di premio, nonché di quella di contributo eventualmente collegata in modalità "pacchetto giovani".

 Il PSA dovrà sviluppare i seguenti punti:

 - -la situazione aziendale di partenza, da cui si rilevino gli elementi cardine specifici, incluso il mercato di riferimento, la strategia commerciale e l'integrazione con il territorio, l'organizzazione (del ciclo produttivo ed aziendale nel suo complesso);
 - -il progetto imprenditoriale per lo sviluppo dell'azienda, con la definizione delle tappe essenziali e degli obiettivi di sviluppo;
 - -i particolari delle azioni, incluse quelle inerenti al miglioramento della

sostenibilità ambientale e all'efficienza delle risorse, occorrenti per lo sviluppo dell'azienda, con particolare riferimento a:
 - -fabbisogno di formazione/consulenza del giovane imprenditore con particolare riferimento alle tematiche ambientali. Nei casi di carenza formativa, in funzione del requisito della capacità professionale, il PSA dovrà obbligatoriamente contenere la previsione della formazione necessaria al raggiungimento di detta capacità;
 - -investimenti previsti (programma analitico degli investimenti comprensivo di crono-programma);
 - -ogni altra azione ritenuta necessaria per lo sviluppo aziendale.

 Per risultare ammissibile il PSA dovrà inoltre:

 - -dimostrare che il premio/i premi saranno integralmente utilizzati per lo sviluppo dell'azienda (vedi successivo punto 9);

 - -evidenziare la sostenibilità economica e finanziaria delle azioni previste tramite previsioni economico-finanziarie adeguatamente sviluppate in base alle indicazioni di cui al successivo punto 11;
 - -prevedere che il/i giovane/i saranno conformi alla definizione di "agricoltore in attività" di cui all'art. 9 del Reg. (UE) n. 1307/2013 entro 18 mesi dalla data di concessione;
 - -conseguire un punteggio di merito, sulla base dei criteri di priorità descritti nella Tabella di cui al successivo punto 15.2, non inferiore a 4 punti.

 Durante il periodo di vigenza del PSA l'impresa non potrà presentare ulteriori PI a valere sul tipo di operazione 4.1.01.

 ## 8.2. Pluralità di insediamenti

 In caso di pluralità di insediamenti contestuali nella medesima impresa si prevede la presentazione di un unico PSA, che dovrà evidenziare l'apporto di ogni singolo beneficiario al processo di sviluppo stesso.

 Non è consentito il coinsediamento di nuovi soggetti durante l'arco temporale di realizzazione del PSA, fatti salvi i casi di forza maggiore; in tale eventualità, il coinsediamento non potrà comunque essere oggetto di ulteriore domanda di premio.

 Successivamente alla chiusura del PSA, qualora un ulteriore insediamento abbia luogo in una azienda già oggetto di un precedente insediamento agevolato dal tipo di operazione, il cui beneficiario risulti ancora nel corso del periodo vincolativo alla conduzione aziendale al momento di presentazione della

prerogative:

 - 8.5.1. qualora al PSA sia collegato un PI che faccia riferimento ad investimenti necessari per ottemperare a requisiti comunitari vigenti, l'azienda entro il termine del PSA dovrà risultare adeguata in rispondenza a detti requisiti; in caso di riscontro negativo in sede di accertamento finale sulla completa e corretta realizzazione del PSA il premio ed il contributo saranno revocati e gli importi eventualmente già liquidati saranno recuperati;
 - 8.5.2. in caso di azienda con produzioni viticole, al termine del PSA questa dovrà aver effettuato eventuali nuovi impianti/reimpianti nel rispetto del vigente regime autorizzatorio;
 - 8.5.3. qualora il PSA preveda l'accesso integrato al tipo di operazione 4.1.02 dovranno essere fornite tutte le informazioni necessarie alla valutazione della relativa domanda di finanziamento. La decadenza della domanda sul tipo di operazione 6.1.01 costituirà motivo dell'inammissibilità della domanda correlata sul tipo di operazione 4.1.02 e della revoca del contributo eventualmente già concesso.

 ## 9. Criteri per verificare che l'importo del premio sia integralmente utilizzato per lo sviluppo dell'azienda

 La necessaria dimostrazione che il premio/i premi saranno integralmente utilizzati per lo sviluppo dell'azienda sarà verificata in sede di istruttoria di ammissibilità sulla base delle previsioni del/dei beneficiario/i.

 In sede di accertamento dell'effettiva e corretta implementazione del PSA le spese complessivamente sostenute per l'attuazione dello stesso dovranno risultare di importo pari o superiore a quello del premio/dei premi percepito/i sulla base dei documenti di spesa che dovranno essere allegati alla domanda di pagamento finale. Tutti gli importi computati a tale scopo si intendono al netto di IVA.

 Si intendono sostenute per l'attuazione del PSA le spese collegate alle azioni previste dal PSA stesso; nel caso degli investimenti finanziati mediante accesso al "pacchetto giovani" in modo combinato con il tipo di operazione 4.1.02, la spesa sostenuta dovrà essere considerata al netto dell'importo del contributo percepito, ovvero:

 [Importo premi] < { [Importo complessivo PSA] - [Contributo PI] }

 Nel caso in cui per sviluppare l'attività il PSA preveda l'ampliamento aziendale, se

siano adempimenti ad eventuali prescrizioni derivanti da normative sovraordinate;
 - 15.2.3. In relazione all'azione e 6, per l'attribuzione del punteggio la relazione tecnica dovrà evidenziare che gli investimenti considerati sono coerenti con le disposizioni del Piano di Azione Nazionale per l'uso sostenibile dei Fitofarmaci ("PAN", di cui al Decreto interministeriale 22 gennaio 2014) Azione A.6.1, commi 1, 2, 3, 4 e 5. Sono esclusi i sistemi aziendali di trattamento chimico, fisico, o biologico di cui alla medesima Azione comma 7, in quanto a tutt'oggi privi dell'autorizzazione prevista dalle Linee guida nazionali;
 - 15.2.4. In relazione alle azioni f 2, f 3 ed f 4, il punteggio è attribuito se il PSA prevede che a consuntivo la certificazione sia posseduta e che ci siano state azioni riconducibili ai sistemi certificati, inclusa la certificazione stessa; in particolare:
 - -il riferimento dell'azione f 2 si intende ai prodotti biologici ottenuti ai sensi

 del Reg. (CE) n. 834/2007 e del Reg. (UE) n. 848/2018;

 - -il riferimento dell'azione f 3 si intende alle produzioni
 - -Dop, Igp, Stg iscritte nei registri creati e aggiornati ai sensi degli articoli 11 e 22 del Reg. (UE) n. 1151/2012 del Parlamento Europeo e del Consiglio (http://ec.Europa.eu/agriculture/quality/door/list.html);
 - -indicazioni geografiche delle bevande spiritose registrate ai sensi del Reg. (CE) n. 110/2008 del Parlamento Europeo e del Consiglio (http://ec.Europa.eu/agriculture/spirits/);
 - -vini aromatizzati, bevande aromatizzate a base di vino e cocktail aromatizzati di prodotti vitivinicoli conformi al Reg. (UE) n. 251/2014 del Parlamento Europeo e del Consiglio;
 - -denominazioni di origine e indicazioni geografiche nel settore vitivinicolo iscritte nel registro creato e aggiornato ai sensi dell'articolo 104 del Reg. (UE) n. 1308/2013 del Consiglio (http://ec.Europa.eu/agriculture/markets/wine/e-bacchus/index.cfm).

- -il riferimento dell'azione f 4 è a produzioni
 - -SQNPI - Sistema di qualità nazionale di produzione integrata (articolo 2, comma 3 della Legge 3 febbraio 2011, n. 4), notifica n. 2012/0387/I (Direttiva 98/34/CE), Decreto del Ministro delle Politiche agricole alimentari e forestali dell'8 maggio 2014 (http://www.reterurale.it/produzioneintegrata);
 - -SQNZ - Sistema di qualità nazionale zootecnia (Decreto del Ministro delle Politiche agricole alimentari e forestali del 4 marzo 2011), Provvedimento MIPAAF 25/10/11, notifica n. 2014/0025/I (Direttiva 98/34/CE)
 - http://www.politicheagricole.it/flex/cm/pages/ServeBLOB.php/L/IT/ID;
 - -QC - Qualità Controllata - Produzione integrata rispettosa dell'ambiente e della salute -Legge regionale dell'Emilia-Romagna 28/99 (http://agricoltura.regione.emilia-romagna.it/produzioniagroalimentari/temi/qualita/marchio-qc).

 Pertanto, con riferimento ai diversi regimi, devono essere conseguite entro il termine di realizzazione del PSA:

 - a) l'iscrizione al sistema di controllo, successiva alle necessarie attività di verifica documentale e ispettiva, per i regimi di cui all'articolo 16, paragrafo 1, lettera a) del Regolamento (UE) n. 1305/2013, tranne che per il regime dei prodotti biologici ottenuti ai sensi del Reg. (CE) n. 834/2007 e del Reg. (UE) n. 848/2018;
 - b) l'emissione del documento giustificativo che attesta che l'azienda soddisfa i requisiti previsti dal Regolamento comunitario, successiva alle necessarie attività di verifica documentale e ispettiva,

 per il regime dei prodotti biologici ottenuti ai sensi del Reg. (CE) n. 834/2007 e del Reg. (UE) n. 848/2018;

 - c) l'iscrizione al sistema di controllo, successiva alle necessarie attività di verifica documentale e ispettiva, per i regimi di cui all'articolo 16, paragrafo 1, lettera b) del Regolamento (UE)

n. 1305/2013.
 - 15.2.5. In relazione all'azione g 1, ai fini dell'attribuzione del punteggio si considera "significativa diversificazione dell'orientamento produttivo" l'introduzione di una nuova coltura/allevamento (con riferimento all'ordinamento produttivo di partenza) che abbia incidenza minima del 15% in base al rapporto [Standard Output nuova coltura-allevamento] / [S.O. Complessivo iniziale] es. se S.O. iniziale = 100 Euro, a conclusione del PSA almeno 15 Euro nello S.O. finale dovranno risultare apportati dalla nuova coltura/specie zootecnica, che non potrà risultare semplicemente sostitutiva di una di quelle precedentemente attuate/allevate. Il punteggio è attribuibile ove siano presenti spese connesse alla nuova coltura/allevamento;
 - 15.2.6. In relazione all'azione g 6, in sede di verifica finale della corretta implementazione del PSA il punteggio si considererà confermabile solo in presenza di regolare registrazione/autorizzazione del Comune / (AUSL, se dovuta) competente;
 - 15.2.7. In relazione all'azione l si precisa che il punteggio si considererà attribuibile in caso di realizzazione di investimenti quali, ad es.: locali specifici (zona infermeria, zona quarantena, zona deposito animali morti, ecc...), rispondenti alle indicazioni riportate nella normativa di settore (es. apposizione cartelli segnaletici, celle frigorifere, pavimentazione adeguata, ecc...). Nel caso di specie zootecniche per le quali esistono adempimenti cogenti a norma di legge, il punteggio sarà attribuibile esclusivamente per interventi che vadano oltre tali adempimenti. Il rispetto di tale condizione deve essere necessariamente evidenziato in modo circostanziato nella relazione tecnica.

