 Reg. (UE) n. 1375/2015 della Commissione del 10 agosto 2015 che definisce norme specifiche applicabili ai controlli ufficiali relativi alla presenza di Trichine nelle car

ni;

 - O.M. 21/04/2021 e successive modifiche del Ministero della Salute recante" Proroga e modifica dell'ordinanza 26 agosto 2005, e successive modificazioni, concernente «Misure di polizia veterinaria in materia di malattie infettive e diffusive dei volatili da cortile»;

 Deliberazione della Giunta regionale n. 359/2021 recante "Approvazione piano di

