 Deliberazione della Giunta regionale n. 1248/2008 recante "Linee guida per la gestione e il controllo sanitario dell'allevamento di suini all'aperto. Criteri di biosicurezza".

 ## II Sezione - Descrizione requisiti e condizioni tipo di operazione 4.1.02

 ## 16. Riferimenti normativi

 I riferimenti normativi sono

