 La revoca del contributo comporta l'obbligo della restituzione delle somme percepite, con interesse calcolato a tasso legale, maggiorato di due punti a titolo di sanzione amministrativa.

 Restano ferme le disposizioni in ordine all'esclusione da ogni provvidenza in materia di agricoltura nell'ipotesi prevista dall'art. 9, comma 1, lett. c) della L.R. n. 15/2021.

 Nell'atto formale di revoca verrà fissata l'eventuale durata dell'esclusione dalle provvidenze.

 Per le difformità riscontrate in relazione alle spese riconoscibili in sede di verifica della domanda di pagamento, si applicano inoltre le sanzioni previste dall'art. 63 del Reg. (UE) n. 809/2014.

 Le riduzioni di cui al punto 29.1 si calcolano all'importo risultante dopo l'applicazione di ogni altra riduzione e sanzione.

